import { Link } from 'react-router-dom';

const NotFound = () => {
  return (
    <div className='not-found bg-contain bg-no-repeat min-h-full z-10'>
      <div className='z-0'>
        <h2>Sorry</h2>
        <p>That page cannot be found</p>
        <Link to='/'>Back to the homepage...</Link>
      </div>
    </div>
  );
};

export default NotFound;
